      <Card.Body>

        <Text h1 size={40}
       css={{
        textGradient: "45deg, $blue600 -20%, $pink600 50%",
      }}
        weight="bold">Resultado</Text>
        <Spacer y={1} />
        <Text blockquote>Solucion: {result}</Text>
      </Card.Body>
    </Card>
    )
}
